                            Title = "국힘 대선후보, 다시 김문수로…하루도 안돼 끝난 후보교체 촌극(종합)",
                            TitleVietSub = "Ứng cử viên tổng thống của Đảng Quyền lực Nhân dân, trở lại với Kim Moon-soo… Trò hề thay đổi ứng cử viên kết thúc trong chưa đầy một ngày (toàn diện)",
                            UpdatedDate = new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified),
                            VietSubContent = "Đảng Quyền lực Nhân dân tuyên bố lúc 11:00 sáng ngày 10 rằng động thái tái bầu ứng cử viên của đảng đã bị bác bỏ trong cuộc bỏ phiếu ARS của tất cả các thành viên đảng. Vào ngày này, Đảng R đã tổ chức một cuộc bỏ phiếu giữa các thành viên để bầu lại Han Deok-soo làm ứng cử viên tổng thống của đảng, thay thế Kim Moon-soo, người đã bị tước tư cách ứng cử. Shin Dong-wook, người phát ngôn chính của Đảng Quyền lực Nhân dân, không tiết lộ con số chính xác, chỉ giải thích rằng con số này đã bị bác bỏ với tỷ lệ \"sít sao\".\r\n\r\nSau khi phiếu bầu bị bác bỏ, Ứng cử viên Kim đã giành lại vị thế là ứng cử viên tổng thống của Đảng Quyền lực Nhân dân. Đã 22 giờ trôi qua kể từ khi ông bị tước tư cách ứng cử tổng thống vào sáng sớm nay. Đảng Quyền lực Nhân dân có kế hoạch bắt đầu quá trình đăng ký cho ứng cử viên Kim vào ngày 11. Ứng cử viên Kim mô tả đây là chuyện đương nhiên. Ông nói, “Mọi thứ sẽ trở lại đúng vị trí của nó,” và “Tôi sẽ ngay lập tức thành lập một ủy ban đặc biệt và dựng một căn lều lớn để xây dựng mặt trận chống Lee Jae-myung (ứng cử viên tổng thống của Đảng Dân chủ Hàn Quốc).”\r\n\r\nPhía ứng cử viên Han Deok-soo, người được kỳ vọng sẽ được Đảng Quyền lực Nhân dân đề cử làm ứng cử viên tổng thống, cho biết: \"Chúng tôi sẽ khiêm tốn chấp nhận ý nguyện của người dân và các đảng viên\" và \"Chúng tôi chân thành hy vọng rằng ứng cử viên Kim Moon-soo và Đảng Quyền lực Nhân dân sẽ giành chiến thắng trong cuộc bầu cử tổng thống này\". Ông dự kiến ​​sẽ thực hiện các bước để không ra tranh cử vì ông đã tuyên bố rằng ông sẽ không ra tranh cử tổng thống trừ khi có một ứng cử viên duy nhất được thành lập trước thời hạn đăng ký ứng cử viên (ngày 11).\r\n\r\nBan lãnh đạo Đảng Quyền lực Nhân dân đã tổ chức một cuộc họp của ủy ban ứng phó khẩn cấp vào khoảng 1:00 sáng ngày hôm đó và tước tư cách ứng cử viên tổng thống của đảng đối với ứng cử viên Kim Moon-soo. Sau đó, vào lúc 3-4 giờ sáng cùng ngày, quá trình đăng ký ứng cử viên được lặp lại và chỉ có ứng cử viên Han Deok-su, người trước đó ứng cử với tư cách độc lập, gia nhập đảng và ra tranh cử với tư cách là ứng cử viên. Đây là sự kiện chưa từng có trong lịch sử lập hiến khi hai đảng trong Quốc hội rút ứng cử viên của mình hai ngày trước khi chiến dịch tranh cử chính thức bắt đầu (ngày 12). Tuy nhiên, nỗ lực này đã bị hủy bỏ khi khả năng tái đắc cử của ứng cử viên bị bác bỏ trong cuộc bỏ phiếu của các thành viên đảng.\r\n\r\nKwon Young-se, chủ tịch ủy ban ứng phó khẩn cấp của Đảng Quyền lực Nhân dân, người lãnh đạo việc thay thế các ứng cử viên, đã nộp đơn từ chức. Ứng cử viên Kim có kế hoạch từ chức ngay sau khi quá trình đăng ký ứng cử hoàn tất. Ông cho biết, \"Đó là quyết định được đưa ra theo nguyện vọng của các đảng viên với sự chân thành nhằm đề cử một ứng cử viên có năng lực cạnh tranh, nhưng cuối cùng, tôi đã không nhận được sự đồng thuận của các đồng chí trong đảng\". Ông nói thêm, \"Thật không may là chúng ta không thể đạt được sự thống nhất, nhưng tôi tin rằng điều này cũng là do những thiếu sót của tôi.\" Mặc dù người đứng đầu đảng Kwon Seong-dong sẽ giữ chức quyền chủ tịch ủy ban khẩn cấp, nhưng có vẻ như ứng cử viên Kim, người ưu tiên các vấn đề của đảng (hiến chương của Đảng Quyền lực Nhân dân quy định rằng các ứng cử viên tổng thống có thẩm quyền ưu tiên đối với mọi vấn đề của đảng), sẽ nắm quyền kiểm soát đảng.\r\n\r\nTuy nhiên, khi cuộc bầu cử tổng thống chỉ còn chưa đầy một tháng nữa, ứng cử viên Kim phải đối mặt với nhiệm vụ giải quyết xung đột nội bộ. Trong quá trình thống nhất các ứng cử viên, nhóm lãnh đạo chính thống ủng hộ Yoon (ủng hộ Yoon Seok-yeol) của Đảng Quyền lực Nhân dân đã không kiềm chế được việc sử dụng ngôn ngữ cực đoan đối với ứng cử viên Kim, chẳng hạn như \"một ứng cử viên tổng thống đáng thương \" và \"thật thảm hại\". Ứng cử viên Kim cũng bày tỏ thái độ thù địch sau khi thua cuộc, gọi đó là một \"cuộc đảo chính chính trị\". Những nhân vật chống Yoon Seok-yeol từ Đảng Quyền lực Nhân dân, bao gồm cựu lãnh đạo đảng Han Dong-hoon và nhà lập pháp Ahn Cheol-soo, cũng chỉ trích mạnh mẽ phe ủng hộ Yoon và ủng hộ ứng cử viên Kim. Loại xung đột này dự kiến ​​sẽ tiếp tục không chỉ trong cuộc bầu cử tổng thống mà còn trong cuộc bầu cử lãnh đạo tiếp theo của Đảng Quyền lực Nhân dân sau cuộc bầu cử tổng thống.",
