                            BlogImageUrl = "https://res.cloudinary.com/dmsi8fr0l/image/upload/v1746903467/newCoin_idcxma.jpg",
                            Content = "가상화폐가 상승세를 지속하는 가운데 시가총액 2위 이더리움의 급등세가 예사롭지 않다.\r\n\r\n9일(현지시간) 미국 가상화폐 거래소 코인베이스에 따르면 미 동부 시간 이날 오후 2시4분(서부 오전 11시 4분) 이더리움 1개당 가격은 24시간 전보다 15.08% 급등한 2347달러에 거래됐다.\r\n\r\n이는 같은 시간 2.27% 오른 가상화폐 대장주 비트코인이나 한국인의 매매가 가장 많은 것으로 알려져 있는 엑스알피(리플)의 5.94%보다 상승률은 크게 앞선다.\r\n\r\n솔라나와 도지코인도 각각 8.22%와 8.47% 올랐지만, 이더리움의 상승률에 미치지 못한다.\r\n\r\n이더리움은 전날에도 10% 넘게 치솟으며 2000달러선을 회복했다.\r\n\r\n일주일 전 1800달러대였던 것에 비해 30% 이상 뛰었다. 블룸버그 통신은 “이는 저금리와 투기적 과열로 코로나19 기간 당시 가상화폐 붐이 일었던 2021년 이후 가장 큰 주간 상승폭”이라고 분석했다.\r\n\r\n이더리움의 급등세는 글로벌 무역 긴장 완화와 네트워크 업그레이드에 대한 낙관론 때문으로 보인다. 미국과 영국 간 새로운 무역 협정 체결 이후 가상자산 전반에 따른 투자 심리가 개선되고 있기 때문이다.\r\n\r\n이더리움의 지속적인 기술 업그레이드에 대한 투자자들의 관심이 집중된 점도 가격을 끌어올리고 있다.\r\n\r\n이더리움은 최근 ‘펙트라(Pectra)’라는 업그레이드를 단행했다. 이번 업그레이드는 거래 수수료 인하와 네트워크 효율성 향상에 중점을 두고 있어 향후 거래 활성화에 대한 기대감이 나오고 있다. 가상화폐 분석업체 BRN의 수석 리서치 애널리스트 발랑탱 푸르니에는 “모멘텀이 강해 상승세가 지속될 가능성이 있다”며 “이번 가격 상승과 향후 정책적 지원은 (가상화폐에 대한) 새로운 투자자 유입으로 이어질 것”이라고 내다봤다.",
                            CreateadBy = new Guid("00000000-0000-0000-0000-000000000000"),
                            CreatedDate = new DateTime(2025, 5, 12, 15, 53, 12, 608, DateTimeKind.Local).AddTicks(7900),
                            IsActive = false,
                            Title = "“일주일간 30% 이상 뛰었다”…급등세 예사롭지 않은 이 가상화폐",
                            TitleVietSub = "“Nó đã tăng hơn 30% trong một tuần”… Tiền điện tử này đang trải qua một đợt tăng giá phi thường",
                            UpdatedDate = new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified),
                            VietSubContent = "Khi tiền ảo tiếp tục tăng, sự gia tăng của Ethereum, loại tiền điện tử lớn thứ hai theo vốn hóa thị trường, là điều bất thường.\r\n\r\nTheo sàn giao dịch tiền điện tử Coinbase của Hoa Kỳ, vào lúc 2:04 chiều ngày 9 (giờ địa phương), giờ miền Đông (11:04 sáng giờ Thái Bình Dương), giá 1 Ethereum được giao dịch ở mức 2.347 đô la, tăng 15,08% so với 24 giờ trước.\r\n\r\nĐây là mức tăng cao hơn nhiều so với mức tăng 2,27% trong cùng kỳ của Bitcoin, loại tiền điện tử hàng đầu, hoặc mức tăng 5,94% của XRP (Ripple), được biết đến là loại tiền điện tử được người Hàn Quốc giao dịch nhiều nhất.\r\n\r\nSolana và Dogecoin cũng tăng lần lượt 8,22% và 8,47% nhưng vẫn không bằng mức tăng của Ethereum.\r\n\r\nEthereum tăng vọt hơn 10% vào ngày hôm trước, giành lại mốc 2.000 đô la.\r\n\r\nGiá đã tăng hơn 30% so với mức 1.800 đô la của tuần trước. Bloomberg News phân tích rằng “đây là mức tăng hàng tuần lớn nhất kể từ năm 2021, khi lãi suất thấp và tình trạng đầu cơ quá nóng dẫn đến sự bùng nổ của tiền điện tử trong thời kỳ COVID-19”.\r\n\r\nSự tăng giá của Ethereum dường như được thúc đẩy bởi sự lạc quan về việc giảm bớt căng thẳng thương mại toàn cầu và nâng cấp mạng lưới. Điều này là do tâm lý đầu tư vào tài sản ảo đang được cải thiện sau khi ký kết hiệp định thương mại mới giữa Hoa Kỳ và Vương quốc Anh.\r\n\r\nSự chú ý của các nhà đầu tư tập trung vào những nâng cấp công nghệ đang diễn ra của Ethereum cũng đang đẩy giá lên cao.\r\n\r\nEthereum gần đây đã triển khai bản nâng cấp có tên là 'Pectra' . Bản nâng cấp này tập trung vào việc giảm phí giao dịch và cải thiện hiệu quả mạng lưới, nâng cao kỳ vọng về hoạt động giao dịch gia tăng trong tương lai. Valentin Fournier, nhà phân tích nghiên cứu cấp cao tại công ty phân tích tiền điện tử BRN , cho biết: \"Động lực rất mạnh và xu hướng tăng có thể sẽ tiếp tục\". “Đợt tăng giá này và chính sách hỗ trợ trong tương lai có thể sẽ thu hút thêm nhiều nhà đầu tư mới.”",
                            View = 2900
