                            UpdatedDate = new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified),
                            VietSubContent = "Tàu thăm dò sao Kim Cosmos 482 của Liên Xô, vốn không thể rời khỏi quỹ đạo Trái Đất vào năm 1972, đã kết thúc hành trình 53 năm trong không gian để trở về Trái Đất. Vụ tai nạn không gây ra thiệt hại gì như người ta lo ngại.\r\n\r\nCơ quan Vũ trụ Liên bang Nga (Roscosmos) thông báo rằng Cosmos 482 đã đi vào bầu khí quyển trên Ấn Độ Dương lúc 9:24 sáng (3:24 chiều giờ Hàn Quốc) ngày 10 và rơi xuống biển phía tây Jakarta. Đây cũng là khung thời gian mà các cơ quan theo dõi vật thể vũ trụ mong đợi. Cơ quan Vũ trụ Châu Âu ( ESA ) cho biết Cosmos 482 được phát hiện lần cuối ở Đức ngay trước khi quay trở lại bầu khí quyển.\r\n\r\nCosmos 482 hình trụ nặng 495 kg và có đường kính 1 m. Đầu dò được trang bị tấm chắn nhiệt để bảo vệ tàu vũ trụ khỏi nhiệt độ cao, áp suất và nhiệt ma sát của sao Kim. Tuy nhiên, người ta không biết liệu phần thân chính của tàu vũ trụ có thực sự rơi xuống mà không bốc cháy hay không.",
